import React from 'react';
import ReactDOM from 'react-dom';
import SearchBar from './SearchBar';
import Query from './Query';

class App extends React.Component {
	state = {resultTerm: '', NBAinfo: {}, teamImg: '', imgW: 0}

	searching = (term) => {
		const nbaJSONObject = [
			{conference: "Eastern", name: "Bucks", rank: 1, img: 'data:image/jpeg;base64,'},
			{conference: "Eastern", name: "Raptors", rank: 2, img: 'https://giantbomb1.cbsistatic.com/uploads/original/2/23637/1369189-raptors.jpeg'},
			{conference: "Eastern", name: "Celtics", rank: 3, img: 'https://www.oncoloring.com/coloreadas/celtics-logo_1353698838_img.gif'},
			{conference: "Eastern", name: "Pacers", rank: 4, img: 'data:image/jpeg;base64,'},
			{conference: "Eastern", name: "Heat", rank: 5, img: 'https://pixy.org/src/454/4545259.jpeg'},
			{conference: "Eastern", name: "76ers", rank: 6, img: 'https://upload.wikimedia.org/wikipedia/en/thumb/0/0e/Philadelphia_76ers_logo.svg/1200px-Philadelphia_76ers_logo.svg.png'},
			{conference: "Eastern", name: "Nets", rank: 7, img: 'https://upload.wikimedia.org/wikipedia/en/thumb/0/0e/Philadelphia_76ers_logo.svg/1200px-Philadelphia_76ers_logo.svg.png'},
			{conference: "Eastern", name: "Magic", rank: 8, img: 'data:image/png;base64,'},
			{conference: "Western", name: "Lakers", rank: 1, img: 'https://images.camperid.com/fanmats/items/18839.jpg'},
			{conference: "Western", name: "Clippers", rank: 2, img: 'https://content.sportslogos.net/news/2014/06/ClippersF.png'},
			{conference: "Western", name: "Nuggets", rank: 3, img: 'data:image/png;base64,'},
			{conference: "Western", name: "Rockets", rank: 4, img: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTwuzGwpHPaQNiB4_dHORmFMyHC3_awJNgM1w&usqp=CAU'},
			{conference: "Western", name: "Thunder",rank: 5, img: 'data:image/png;base64,'},
	  		{conference: "Western", name: "Jazz", rank: 6, img: 'https://i.pinimg.com/originals/ef/ee/58/efee58287e5fe6bda09565415ccd76c3.png'},
			{conference: "Western", name: "Mavericks", rank: 7, img: 'data:image/png;base64,'},
			{conference: "Western", name: "Trail Blazers", rank: 8, img: 'data:image/png;base64,'}
	];
	


	for(let i = 0; i<17; i++){
		if (i<16 && term.toUpperCase() === nbaJSONObject[i].name.toUpperCase()){
			this.setState({NBAinfo: nbaJSONObject[i]})
			this.setState({message: nbaJSONObject[i].name +' are #' +nbaJSONObject[i].rank +' in the ' +nbaJSONObject[i].conference +' Conference.'})
			this.setState({teamImg: nbaJSONObject[i].img})
			break;
		}
		else if (i === 16) {
			this.setState({NBAinfo: {name: 'Grape flavored jolly ranchers are the good'}})
			this.setState({message: 'I\'m sorry, but you have not entered a valid team to search for... sucks to suck, I guess'})
			this.setState({teamImg: 'data:image/png;base64,'})
		}
	}
	}

	onSearchSubmit = (term) => {
		console.log('this is the term returned by the search bar component back to the parent app based component: ' +term);
		this.setState({resultTerm: term})
		this.searching(term);
		this.setState({imgW: 500})
	}

	render () {
		return(
			<div className = "main">
				<div className = "ui container" style = {{marginTop: '10px'}}>
			      	<SearchBar onSubmit = {this.onSearchSubmit}/>
			      	<Query
			      		img = {this.state.teamImg}
			      		name = {this.state.NBAinfo.name}
			      		imgW = {this.state.imgW}
			      		message = {this.state.message}
			      	/>
			    </div>
			</div>
		  );
	};
}


export default App;